import React, { ReactNode } from 'react';
import { Route } from 'react-router-dom';

const RouteWithProps: React.FC<{
  path: string;
  component: ReactNode;
  p: any;
}> = function ({ path, component: Comp, p }) {
  return (
    <Route
      exact
      path={path}
      render={(props): ReactNode => {
        return <Comp {...{ props }} />;
      }}
    />
  );
};
export { RouteWithProps };
